import { Container, Gradient } from './HomeElements';
import Background from '../../Images/home-background.png';

const Home = () => {
    return (
        <Container image={Background}>
            <Gradient>
                <span style={{color: 'white'}}>Julian van Beek</span>
                <p style={{color: 'white'}}>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip.</p>
            </Gradient>
        </Container>
    );
}

export default Home;
